import './App.css';
import React, { useRef } from 'react';
import TextEditor from './components/TextEditor.js';


function App() {
  const editorRef = useRef(null);
  const log = () => {
    if (editorRef.current) {
      console.log(editorRef.current.getContent());
    }
  };
  return (
    <div className="App">
      <TextEditor/>
    </div>
  );
}

export default App;
